	var parent = this.parameters.generated_map.parent;

	var afterDialog = function(){
		player.hasControl = true;
		game.display.camera.addAction(new ArcCameraFadeIn(1000, function(camera){}, 0.0, 0.0, 0.0));	
	};
	var afterBump = function(camera){
		var door = Math.floor(Math.random() * 2) + 1;
		//parent.load("jail", "MainStart");
		 //npc.TriggerDialog('GUARD_2', worldAdapter, player,  afterDialog);
		parent.load("game_4", "FromPrison" + door);
		game.display.camera.addAction(new ArcCameraFadeIn(200, function(camera){}, 1.0, 1.0, 1.0));		
	};

	game.display.camera.addAction(new ArcCameraFadeOut(200, afterBump, 1.0, 1.0, 1.0));
};

